import KanbasNavigation from "./KanbasNavigation";
import {icons} from "react-icons";

function Kanbas() {
    return (
        <div className="d-flex">
            <KanbasNavigation />
            <div>
                <h1>Account</h1>
                <h1>Dashboard</h1>
                <h1>Courses</h1>
            </div>
        </div>
    );
}
export default Kanbas;
